import React from 'react';
import Navbar from './navbar';
import './projects.css';
import reactImage from './images/myflix client react.png';
import { Card, Button } from 'react-bootstrap';


const Projects = () => {

  const projects = [
    
    {
      id: 1,
      title: 'Pokemon',
      image: 'project1.jpg',
      Description:'',
      demoLink: 'https://tinabhowal.github.io/simple-js-app/',
      githubLink: 'https://github.com/tinabhowal/simple-js-app',
      
    },

    {
      id: 2,
      title: 'NewPokemon',
      image: 'project1.jpg',
      Description:'',
      demoLink: '',
      githubLink: 'https://github.com/tinabhowal/newCartoon/tree/main',
      
    },

    {
      id: 3,
      title: 'myFlix-api',
      image: 'project1.jpg',
      Description:'',
      demoLink: '',
      githubLink: 'https://github.com/tinabhowal/movie_api',
      
    },

    {
      id: 4,
      title: 'myFlix-client-React',
      image: {reactImage},
      Description:'',
      demoLink: 'https://figma--mymoviesflix.netlify.app/login',
      githubLink: 'https://github.com/tinabhowal/myFlix-client',
      
    },

    {
      id: 5,
      title: 'myFlix-client-Angular',
      image: 'project1.jpg',
      Description:'',
      demoLink: 'https://tinabhowal.github.io/myFlix-Angular-client/welcome',
      githubLink: 'https://github.com/tinabhowal/myFlix-Angular-client',
     
    },

    {
      id: 6,
      title: 'MeetApp',
      image: 'project1.jpg',
      Description:'',
      demoLink: 'https://tinabhowal.github.io/meet/',
      githubLink: 'https://github.com/tinabhowal/meet',
      
    },

    {
      id: 7,
      title: 'ChatApp',
      image: 'project1.jpg',
      Description:'',
      githubLink: 'https://github.com/tinabhowal/Chat-App',
      
    },

    {
      id: 8,
      title: 'My first practice portfolio',
      image: 'project1.jpg',
      Description:'',
      demoLink: 'https://tinabhowal.github.io/tinaprofile/careerfoundry/',
      githubLink: 'https://github.com/tinabhowal/tinaprofile',
      
    },
    
  ];
  return (
    // <div className='projectsPage'>
    //   <Navbar></Navbar>
    //   <div className='header'>Projects</div>
    //   <div className='body'>

    //   </div>
    // </div>


    <div className='projects'>
      {/* Your Navbar component */}
      <Navbar></Navbar>
      <div className='header'>Projects</div>
      <div className='body'>
        {projects.map((project) => (
          <Card key={project.id} style={{ width: '18rem' }}>
            <Card.Img variant='top' src={project.image} />
            <Card.Body>
              <Card.Title>{project.title}</Card.Title>
              <Button variant='primary' href={project.demoLink}>Demo</Button>{' '}
              <Button variant='dark' href={project.githubLink}>GitHub</Button>{' '}
              {/* <Button variant='info' href={project.userStoryLink}>User Story</Button> */}
            </Card.Body>
          </Card>
        ))}
      </div>
    </div>
  )
}

export default Projects;
